    checkPropSize(){
        let cnt=0;
        for(var k in this.props.data){
            cnt++;}
        return cnt>1 ? true :  false
    }
    render(){

    let ovenview=null;
    let view=null;
    // let setupsArr=setupData.data;
    console.log(this.props.data);

    view=Object.entries()

    if( this.props.data.length>1 ) {
        ovenview = <div className="oven-wrapper">
            <div className="oven-section1">
                <div>State</div>
