                <div>available</div>
                <div>found</div>
                <div>NF</div>
                <div>NA</div>
            </div>
            <div className="oven-section4">
                analytics
            </div>
        </div>
    }


    return(
        <div>{ovenview!=null ? (
        {ovenview}
    ):(
            <Loader/>
    )
    }
        </div>
    )
}
}

export default OvenItem;
